Here's an example of a simple C++ function that converts basic Markdown syntax to HTML:

```cpp
#include <iostream>
#include <string>
#include <cassert>

std::string markdownToHtml(const std::string& markdown) {
    std::string html;

    // Replace Markdown headings with HTML <h1> to <h6>
    size_t pos = 0;
    while ((pos = markdown.find("#", pos)) != std::string::npos) {
        size_t endPos = markdown.find_first_of("\r\n", pos);
        if (endPos == std::string::npos) endPos = markdown.size();
        int level = 1;
        while (pos > 0 && markdown[pos - 1] == '#') {
            level++;
            pos--;
        }
        html += "<h" + std::to_string(level) + ">" + markdown.substr(pos + 1, endPos - pos - 1) + "</h" + std::to_string(level) + ">";
        pos = endPos;
    }

    // Replace Markdown bold text with HTML <strong>
    pos = 0;
    while ((pos = markdown.find("**", pos)) != std::string::npos) {
        size_t endPos = markdown.find("**", pos + 2);
        if (endPos == std::string::npos) break;
        html += markdown.substr(pos, 2) + "<strong>" + markdown.substr(pos + 2, endPos - pos - 2) + "</strong>";
        pos = endPos + 2;
    }

    // Replace Markdown italic text with HTML <em>
    pos = 0;
    while ((pos = markdown.find("*", pos)) != std::string::npos) {
        size_t endPos = markdown.find("*", pos + 1);
        if (endPos == std::string::npos) break;
        html += markdown.substr(pos, 1) + "<em>" + markdown.substr(pos + 1, endPos - pos - 1) + "</em>";
        pos = endPos + 1;
    }

    // Replace Markdown newlines with HTML <br>
    html = markdown.replace(markdown.find("\n"), 1, "<br>");

    // Trim leading and trailing whitespace
    html = html.empty() ? "" : std::regex_replace(html, std::regex("^\\s+|\\s+$"), "");

    return html;
}

int main() {
    std::string markdown = "# Header 1\n## Header 2\n**Bold Text**\n*Italic Text*\n\nThis is a paragraph.\n";
    std::string html = markdownToHtml(markdown);

    std::cout << "Markdown:\n" << markdown << "\n\nHTML:\n" << html << std::endl;

    assert(html == "<h1>Header 1</h1><h2>Header 2</h2><strong>Bold Text</strong><em>Italic Text</em><br>This is a paragraph.<br>");

    return 0;
}
```

### Explanation:
- **Heading Conversion**: The function searches for `#` symbols and converts them into HTML heading tags (`<h1>`, `<h2>`, etc.).
- **Bold Text**: The function searches for `**` around text and converts it into HTML strong tags (`<strong>`).
- **Italic Text**: The function searches for `*` around text and converts it into HTML em tags (`<em>`).
