#include <SDL2/SDL.h>
#include <stdio.h>
#include <stdlib.h>

#define SCREEN_WIDTH 640
#define SCREEN_HEIGHT 480

typedef struct {
    int x, y;
} Point;

Point snake[100];
int snake_size = 1;
int direction = 0; // 0: right, 1: down, 2: left, 3: up

void draw_snake(SDL_Renderer *renderer) {
    for (int i = 0; i < snake_size; ++i) {
        SDL_Rect rect = {snake[i].x, snake[i].y, 20, 20};
        SDL_RenderCopy(renderer, gSnakeTexture, NULL, &rect);
    }
}

void move_snake() {
    Point new_head = {snake[0].x, snake[0].y};

    switch (direction) {
        case 0: /* right */
            new_head.x += 20;
            break;
        case 1: /* down */
            new_head.y += 20;
            break;
        case 2: /* left */
            new_head.x -= 20;
            break;
        case 3: /* up */
            new_head.y -= 20;
            break;
    }

    for (int i = snake_size - 1; i > 0; --i) {
        snake[i] = snake[i - 1];
    }
    snake[0] = new_head;
}

void grow_snake() {
    ++snake_size;
}

bool check_collision() {
    for (int i = 1; i < snake_size; ++i) {
        if (snake[0].x == snake[i].x && snake[0].y == snake[i].y) {
            return true;
        }
    }
    return false;
}

int main(int argc, char* argv[]) {
    if (SDL_Init(SDL_INIT_VIDEO) != 0) {
        printf("Could not initialize SDL2: %s\n", SDL_GetError());
        return -1;
    }

    SDL_Window *window = SDL_CreateWindow("Snake Game",
                                          SDL_WINDOWPOS_CENTERED,
                                          SDL_WINDOWPOS_CENTERED,
                                          SCREEN_WIDTH, SCREEN_HEIGHT,
                                          SDL_WINDOW_SHOWN);
    if (!window) {
