        SDL_Quit();
        return -1;
    }

    SDL_Renderer *renderer = SDL_CreateRenderer(window, -1, SDL_RENDERER_ACCELERATED);
    if (!renderer) {
        printf("Could not create renderer: %s\n", SDL_GetError());
        SDL_DestroyWindow(window);
        SDL_Quit();
        return -1;
    }

    // Load snake image
    SDL_Surface *surface = SDL_LoadBMP("snake.bmp");
    if (!surface) {
        printf("Could not load image: %s\n", SDL_GetError());
        SDL_DestroyRenderer(renderer);
        SDL_DestroyWindow(window);
        SDL_Quit();
        return -1;
    }

    gSnakeTexture = SDL_CreateTextureFromSurface(renderer, surface);
    SDL_FreeSurface(surface);

    SDL_Event e;
    bool quit = false;
    bool started = false;

    while (!quit) {
        while (SDL_PollEvent(&e)) {
            if (e.type == SDL_QUIT) {
                quit = true;
            } else if (e.type == SDL_KEYDOWN) {
                switch (e.key.keysym.sym) {
                    case SDLK_UP:
                        if (direction != 1) {
                            direction = 3;
                        }
                        break;
                    case SDLK_DOWN:
                        if (direction != 3) {
                            direction = 1;
                        }
                        break;
                    case SDLK_LEFT:
                        if (direction != 0) {
                            direction = 2;
                        }
                        break;
                    case SDLK_RIGHT:
                        if (direction != 2) {
                            direction = 0;
                        }
                        break;
